import React from "react";
import "./App.css";
import { Stack, Text } from "@fluentui/react";
import { PALETTE } from "./constants";
import { TWEEN } from "./Tween";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

export class App extends React.Component {
  componentDidMount() {
    document.body.style.background = PALETTE.light;
    // function animate() {
    //   requestAnimationFrame(animate);
    //   TWEEN.update();
    // }
    // animate();
  }

  render() {
    return (
      <Router>
        {/* <Header /> */}
        <Stack
          horizontalAlign="center"
          grow
          disableShrink
          styles={{
            root: {
              // paddingTop: HEADER_HEIGHT,
              flexShrink: 0,
              height: "100vh",
            },
          }}
        >
          <Switch>
            <Route path="/higharc-challenge/experience">
              <Text>Experience</Text>
            </Route>
            <Route path="/higharc-challenge/projects">
              <Text>Projects</Text>
            </Route>
            <Route path="/higharc-challenge/education">
              <Text>Education</Text>
            </Route>
            <Route path="/higharc-challenge/research">
              <Text>Research</Text>
            </Route>
            <Route path="/">
              <Text>Home</Text>
            </Route>
          </Switch>
        </Stack>
      </Router>
    );
  }
}
